import React from 'react';
import './GoTrainBtnMobile.scss';

const GoTrainBtnMobile = (props) => {

    return(
        <button className="go-train-mobile-btn" onClick={ () => props.mainToggle} type="button">Go Train</button>
    )
}

export default GoTrainBtnMobile;
